pub enum StdError {
    GenericErr {
            msg: String,
        },
    InvalidBase64 {
            msg: String,
        },
    InvalidDataSize {
            expected: u64,
            actual: u64,
        },
    InvalidUtf8 {
            msg: String,
        },
    NotFound {
            kind: String,
        },
    ParseErr {
            target_type: String,
            msg: String,
        },
    SerializeErr {
            source_type: String,
            msg: String,
        },
    Underflow {
            minuend: String,
            subtrahend: String,
        },
}

pub enum SystemError {
    InvalidRequest {
            error: String,
            request: Binary,
        },
    InvalidResponse {
            error: String,
            response: Binary,
        },
    NoSuchContract {
            addr: HumanAddr,
        },
    Unknown {
        },
    UnsupportedRequest {
            kind: String,
        },
}

pub enum QueryRequest<C: CustomQuery> {
    Bank(BankQuery),
    Custom(C),
    Staking(StakingQuery),
    Wasm(WasmQuery),
}

pub enum BankQuery {
    Balance {
            address: HumanAddr,
            denom: String,
        },
    AllBalances {
            address: HumanAddr,
        },
}

pub enum WasmQuery {
    Smart {
            contract_addr: HumanAddr,
            msg: Binary,
        },
    Raw {
            contract_addr: HumanAddr,
            key: Binary,
        },
}

pub enum StakingQuery {
    BondedDenom {
        },
    AllDelegations {
            delegator: HumanAddr,
        },
    Delegation {
            delegator: HumanAddr,
            validator: HumanAddr,
        },
    Validators {
        },
}

pub enum BankMsg {
    Send {
            from_address: HumanAddr,
            to_address: HumanAddr,
            amount: Vec<Coin>,
        },
}

pub enum StakingMsg {
    Delegate {
            validator: HumanAddr,
            amount: Coin,
        },
    Undelegate {
            validator: HumanAddr,
            amount: Coin,
        },
    Withdraw {
            validator: HumanAddr,
            recipient: Option<HumanAddr>,
        },
    Redelegate {
            src_validator: HumanAddr,
            dst_validator: HumanAddr,
            amount: Coin,
        },
}

pub enum WasmMsg {
    Execute {
            contract_addr: HumanAddr,
            msg: Binary,
            send: Vec<Coin>,
        },
    Instantiate {
            code_id: u64,
            msg: Binary,
            send: Vec<Coin>,
            label: Option<String>,
        },
}
